# Function to predict missing Age
def predict_age(row):
    if np.isnan(row["Age"]):
        group_median = df[
            (df["SibSp"] == row["SibSp"]) &
            (df["Parch"] == row["Parch"]) &
            (df["Pclass"] == row["Pclass"]) &
            (df["Age"].notnull())
        ]["Age"].median()

        return group_median if not np.isnan(group_median) else overall_median_age
    else:
        return row["Age"]

df["Age"] = df.apply(predict_age, axis=1)

